import React from 'react'
import Data from './Data'
import { Card } from 'react-bootstrap';

export default class Popularproduct extends React.Component{
    render(){
        return(
            <div>
                {
                    Data.Product.map((Product,i)=>{
                        return(
                            <Card>
                                <div key={i}>
                                <div>
                        <h1>{Product.title}</h1>
                                </div>
                            </div>
                            </Card>

                        );
                    })
                }
            </div>
        );
    }
}

